import React, { useEffect, useRef } from "react";
import { Background, NavBar } from "../../Components";
import { Box } from "@mui/material";
import { useLocation } from "react-router-dom";

function InviteExpiredPage() {
  const location = useLocation();
  return (
    <>
      <Background rightLeaves leftLeaves rightScratched>
        <Box className="error-page-body">
          <label className="error-title-msg">Uh-oh! The invite has expired</label>
          <label className="error-support-msg">
            {/* The invitation to connect your accounts has expired. Please get in touch with S.H.I.E.L.D for more details. */}
            {location.state.errorMessage}
          </label>
        </Box>
      </Background>
    </>
  );
}

export default InviteExpiredPage;
